import React from 'react';
import ReactDOM from 'react-dom';

const tasks = ['Get up early in the morning', 'Get up early in the morning', 'Start your day'];

const element = <ol>
    <li>{tasks[0]}</li>
    <li>{tasks[1]}</li>
    <li>{tasks[2]}</li>
    </ol>


ReactDOM.render(element, document.getElementById('root'));
